import './Stacks.css';
import {img_stacks} from '../../assets/stacks/list_img_stacks';
import { Modal } from './Modal/Modal';
import { useState } from 'react';


// ITEM STACKS COMPONENT
const StackItem = (props) =>{
    return(
        <div
        className='sectionStacks__item'
        onClick={modalActive}
        >
            <img className='sectionStacks__img' src={props.img} alt={props.alt}/>
        </div>
    );
}

const stackIndex = 1;

const modalActive = () => {
    console.log('yo si estoy funcionando');
}

function Stacks (props){

   const [modal, setModal] = useState(false);

    return(
        <section className={`section sectionStacks ${props.page === 3 ? "active" : null}`}>
            <h1>Habilidades</h1>

            <div className='sectionStacks__stacksList'>
                {
                    img_stacks.map(img => (
                    <StackItem
                        setModal={modalActive}
                        key={img.img}
                        img={img.img}
                        alt={img.alt}
                    />
                    ))
                }
            </div>

            {/* {modal && <Modal stackIndex={stackIndex}/>} */}

        </section>
    );
}

export {Stacks};
